You can terminate a C program by using the `exit()` function. This function is included in the `stdlib.h` library and it takes an integer as an argument which is returned to the operating system as the program's return code.

Here is an example:

```c
#include <stdlib.h>

int main() {
    // Your code here

    exit(0);  // Terminates the program
}
```

In this example, `0` is often used to indicate that the program has finished successfully. Other numbers can be used to indicate different types of errors. The specific meanings of these numbers are usually documented in the program's documentation.

Note: The `return` statement in the `main()` function can also terminate a C program. For example, `return 0;` at the end of the `main()` function will terminate the program.
